import styled from "styled-components";

export const StyledNav = styled.nav`
    display:flex;
    background-color: #0E0E0E;
    height: 84px;
    align-items: center;
    margin-bottom: 20px;

`

export const StyledInput = styled.input`
  margin-top:10px;
  margin-bottom:10px;
  height:100%;
`
